import "./Experience.css";
import { Link } from 'react-router-dom';
import styled from "styled-components";
import amazon from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/amazon.svg";
import ada from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/ada.png";
import LWtech from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/LWtech.png";
import USM from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/USM.png";
import java from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/java.svg";
import react from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/react-2.svg";
import javascript from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/logo-javascript.svg";
import spark from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/spark.svg";
import s3 from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/amazon-s3.svg";
import ec2 from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/aws-ec2.svg";
import css from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/css-3.svg";
import html from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/html-1.svg";
import css3 from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/css3.svg";


const NavUnlisted = styled.ul`
  text-decoration: none;
`;

const StyledLink = styled(Link)`
  color: Blue;
  text-decoration: none;
`

const Experience = () => {
    return(
        <div className="experience-education">
                <div className="font-size: 40px;">
                <NavUnlisted>
                    <StyledLink to="/">Home</StyledLink>
                    <StyledLink to="/about">About</StyledLink>
                    <StyledLink to="/projects">Projects</StyledLink>
                    <form action="https://www.docdroid.net/CFYS6UG/doina-colun-resume-copy-pdf">
                        <button type="submit">Resume</button>
                    </form>
                </NavUnlisted>
                </div>
                <div className="experience-box">
                    <h2>Experience</h2>
                    <div className="header-title">
                        <img src={amazon}/>
                        <h3>Software Engineer Intern - Amazon</h3>
                        <h4>08/2022 - 01/2023</h4>
                    </div>
                </div>
                <div className="education-box">
                    <h2>Education</h2>
                    <div className="header-title">
                        <img src={ada}/>
                        <h3>Ada Developers Academy</h3>
                        <h4>02/2022 - 01/2023</h4>
                    </div>
                    <div className="header-title">
                        <img src={LWtech}/>
                        <h3>Lake Washington Institute of Technology</h3>
                        <h4>09/2019 - 08/2021</h4>
                    </div>
                    <div className="header-title">
                        <img src={USM}/>
                        <h3>Moldova State University</h3>
                        <h4>09/2014 - 07/2017</h4>
                    </div>
                </div>
                <div className="skills">
                    <h2>Skills</h2>
                    <img src={java}/>
                    <img src={react}/>
                    <img src={javascript}/>
                    <img src={spark}/>
                    <img src={s3}/>
                    <img src={ec2}/>
                    <img src={css}/>
                    <img src={html}/>
                    <img src={css3} width="500"/>
                </div>
        </div>
    )  
}

export default Experience;
